// pages/login.js
import React, { useEffect, useMemo, useState } from "react";
import { useRouter } from "next/router";
import { createClient } from "@supabase/supabase-js";

// Embedded STENAU logo (dezent)
const LOGO_DATA = "data:image/png;base64,";

// Supabase (lazy init, avoids SSR/prerender crashes)
const SUPABASE_URL =
  process.env.NEXT_PUBLIC_SUPABASE_URL ||
  process.env.SUPABASE_URL ||
  "";
const SUPABASE_ANON_KEY =
  process.env.NEXT_PUBLIC_SUPABASE_ANON_KEY ||
  process.env.SUPABASE_ANON_KEY ||
  "";

let _supabase = null;
function getSupabaseClient() {
  if (typeof window === "undefined") return null;
  if (_supabase) return _supabase;
  if (!SUPABASE_URL || !SUPABASE_ANON_KEY) return null;
  _supabase = createClient(SUPABASE_URL, SUPABASE_ANON_KEY, {
    auth: { persistSession: true, autoRefreshToken: true, detectSessionInUrl: true },
  });
  return _supabase;
}

const styles = {
  page: {
    minHeight: "100vh",
    display: "grid",
    placeItems: "center",
    padding: 24,
    background:
      "radial-gradient(1200px 600px at 20% 0%, rgba(255,255,255,0.55), rgba(255,255,255,0) 60%)," +
      "radial-gradient(900px 500px at 90% 30%, rgba(255,255,255,0.45), rgba(255,255,255,0) 60%)," +
      "linear-gradient(180deg, rgba(31,88,125,0.85), rgba(31,88,125,0.35) 40%, rgba(255,255,255,0.75) 100%)",
  },
  card: {
    width: "min(980px, 100%)",
    borderRadius: 18,
    border: "1px solid rgba(255,255,255,0.45)",
    background: "rgba(255,255,255,0.65)",
    boxShadow: "0 18px 60px rgba(0,0,0,0.16)",
    backdropFilter: "blur(10px)",
    padding: 18,
    display: "grid",
    gridTemplateColumns: "1.2fr 1fr",
    gap: 18,
  },
  left: {
    borderRadius: 14,
    padding: 18,
    background: "linear-gradient(180deg, rgba(255,255,255,0.75), rgba(255,255,255,0.55))",
    border: "1px solid rgba(180,200,220,0.45)",
    position: "relative",
    overflow: "hidden",
  },
  logoWrap: { display: "flex", alignItems: "center", gap: 12, marginBottom: 10 },
  logo: {
    height: 36,
    width: "auto",
    opacity: 0.9,
    filter: "drop-shadow(0 8px 20px rgba(0,0,0,0.10))",
  },
  title: { fontSize: 28, fontWeight: 900, letterSpacing: -0.4, color: "#0c2a3b" },
  subtitle: { marginTop: 6, color: "rgba(10,35,50,0.75)", lineHeight: 1.4, fontSize: 14, maxWidth: 520 },
  watermark: {
    position: "absolute",
    right: -40,
    bottom: -30,
    width: 260,
    opacity: 0.08,
    transform: "rotate(-8deg)",
    pointerEvents: "none",
  },
  right: {
    borderRadius: 14,
    padding: 18,
    background: "rgba(255,255,255,0.72)",
    border: "1px solid rgba(180,200,220,0.45)",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    gap: 12,
  },
  h2: { fontSize: 16, fontWeight: 900, color: "#0c2a3b" },
  label: { fontSize: 12, fontWeight: 700, color: "rgba(10,35,50,0.8)" },
  input: {
    width: "100%",
    padding: "12px 12px",
    borderRadius: 12,
    border: "1px solid rgba(170,190,210,0.75)",
    background: "rgba(255,255,255,0.8)",
    outline: "none",
    fontSize: 14,
  },
  row: { display: "grid", gap: 8 },
  btn: {
    padding: "12px 14px",
    borderRadius: 12,
    border: "1px solid rgba(35,98,185,0.35)",
    background: "linear-gradient(180deg, rgba(62,146,255,0.95), rgba(35,98,185,0.95))",
    color: "white",
    fontWeight: 900,
    cursor: "pointer",
    boxShadow: "0 10px 22px rgba(35,98,185,0.25)",
  },
  btnGhost: {
    padding: "10px 12px",
    borderRadius: 12,
    border: "1px solid rgba(160,180,200,0.7)",
    background: "rgba(255,255,255,0.7)",
    color: "#123",
    fontWeight: 800,
    cursor: "pointer",
  },
  error: {
    padding: "10px 12px",
    borderRadius: 12,
    border: "1px solid rgba(240,120,120,0.55)",
    background: "rgba(255,230,230,0.65)",
    color: "#8a1f1f",
    fontSize: 13,
    fontWeight: 800,
  },
  hint: { fontSize: 12, color: "rgba(10,35,50,0.65)" },
  split: { display: "flex", gap: 10, alignItems: "center", justifyContent: "space-between" },
};

export default function LoginPage() {
  const router = useRouter();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [loading, setLoading] = useState(false);
  const [err, setErr] = useState("");

  const supabase = useMemo(() => getSupabaseClient(), []);

  useEffect(() => {
    let active = true;
    (async () => {
      if (!supabase) return;
      const { data } = await supabase.auth.getSession();
      if (!active) return;
      if (data?.session) router.replace("/dashboard");
    })();
    return () => {
      active = false;
    };
  }, [router, supabase]);

  async function signIn(e) {
    e.preventDefault();
    setErr("");
    if (!supabase) {
      setErr("Supabase-Konfiguration fehlt (ENV Variablen).");
      return;
    }
    setLoading(true);
    try {
      const { error } = await supabase.auth.signInWithPassword({
        email: email.trim(),
        password,
      });
      if (error) setErr(error.message || "Login fehlgeschlagen.");
      else router.replace("/dashboard");
    } catch (ex) {
      setErr(ex?.message || "Login fehlgeschlagen.");
    } finally {
      setLoading(false);
    }
  }

  async function resetPassword() {
    setErr("");
    if (!supabase) {
      setErr("Supabase-Konfiguration fehlt (ENV Variablen).");
      return;
    }
    if (!email.trim()) {
      setErr("Bitte E-Mail eintragen.");
      return;
    }
    setLoading(true);
    try {
      const { error } = await supabase.auth.resetPasswordForEmail(email.trim(), {
        redirectTo: typeof window !== "undefined" ? `${window.location.origin}/login` : undefined,
      });
      if (error) setErr(error.message || "Konnte E-Mail nicht senden.");
      else setErr("Passwort-Reset E-Mail wurde versendet (falls der Nutzer existiert).");
    } catch (ex) {
      setErr(ex?.message || "Konnte E-Mail nicht senden.");
    } finally {
      setLoading(false);
    }
  }

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <div style={styles.left}>
          <div style={styles.logoWrap}>
            <img src={LOGO_DATA} alt="STENAU" style={styles.logo} />
            <div style={{ display: "flex", flexDirection: "column" }}>
              <div style={styles.title}>Dashboard</div>
              <div style={styles.hint}>Armaturenbrett  Aufgaben  Kalender  Anleitungen</div>
            </div>
          </div>

          <div style={styles.subtitle}>
            Bitte melde dich an, um auf Aufgaben, Serienaufgaben, Bereiche, Anleitungen und die Nutzerverwaltung zuzugreifen.
          </div>

          <img src={LOGO_DATA} alt="" style={styles.watermark} />
        </div>

        <div style={styles.right}>
          <div style={styles.h2}>Anmeldung</div>

          <form onSubmit={signIn} style={{ display: "grid", gap: 12 }}>
            <div style={styles.row}>
              <div style={styles.label}>E-Mail</div>
              <input
                style={styles.input}
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                placeholder="name@stenau.net"
                autoComplete="email"
              />
            </div>

            <div style={styles.row}>
              <div style={styles.label}>Passwort</div>
              <input
                style={styles.input}
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                placeholder="Passwort"
                autoComplete="current-password"
              />
            </div>

            {err ? <div style={styles.error}>{err}</div> : null}

            <div style={styles.split}>
              <button type="submit" style={styles.btn} disabled={loading}>
                {loading ? "Bitte warten" : "Anmelden"}
              </button>

              <button type="button" style={styles.btnGhost} onClick={resetPassword} disabled={loading}>
                Passwort vergessen
              </button>
            </div>
          </form>

          <div style={styles.hint}>
            Tipp: In Vercel mssen NEXT_PUBLIC_SUPABASE_URL und NEXT_PUBLIC_SUPABASE_ANON_KEY gesetzt sein.
          </div>
        </div>
      </div>
    </div>
  );
}
